def maxProduct(nums) -> int:
    
    maxp = nums[0]
    l, r = 0, 1
    
    
    if len(nums) == 1:
        return maxp
    else:
        while l < len(nums) - 1:
            temp = nums[l]
            maxp = max(maxp, nums[l])
            while r < len(nums):
                maxp = max(maxp, nums[r])
                temp = temp * nums[r]
                r += 1
                maxp = max(maxp, temp)
            
            l += 1
            r = l + 1
            
        
            
    return maxp



